import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './Navbar';
import Home from './Home';  // Import your Home component
import Store from './Store';  // Import your Store component
import Learn from './Learn';  // Import your Learn component
import About from './About';  // Import your About component
import Help from './Help';  // Import your Help component
import Contact from './Contact';  // Import your Contact component
import Login from './Login';  // Import your Login component
import SignUp from './SignUp';  // Import your SignUp component

function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route exact path="/" component={Home} />  {/* Home page */}
        <Route path="/store" component={Store} />  {/* Store page */}
        <Route path="/learn" component={Learn} />  {/* Learn page */}
        <Route path="/about" component={About} />  {/* About page */}
        <Route path="/help" component={Help} />  {/* Help page */}
        <Route path="/contact" component={Contact} />  {/* Contact page */}
        <Route path="/login" component={Login} />  {/* Login page */}
        <Route path="/signup" component={SignUp} />  {/* Sign-up page */}
        {/* You can add other routes for additional pages */}
      </Switch>
    </Router>
  );
}

export default App;
